import "./Error.css"; // Assuming the CSS file is named Error.css

const ErrorPage = () => {
  return (
    <div>
      <img src="https://img.freepik.com/free-vector/404-error-with-portals-concept-illustration_114360-7880.jpg?t=st=1727423970~exp=1727427570~hmac=33e0f865d5d2d60929bfb06c22d82120e0f9518711b80b1b691a0b55b668ba27&w=740"/>
    </div>
  );
};

export default ErrorPage;
